function Post(id,title,content,user_id,user_name,time,is_event,comment_count,can_edit,has_more){this.id=id;this.title=ko.observable(title);this.content=ko.observable(content);this.user_id=user_id;this.user_name=user_name;this.time=time;this.is_event=is_event;this.comment_count=comment_count;this.can_edit=can_edit;this.has_more=ko.observable(has_more);this.long_content=ko.observable();this.in_edit=ko.observable(false);this.show_comments=ko.observable(false);var self=this;this.edit=function(){self.in_edit(true);self.new_name(self.name());self.new_type(self.type());}
this.load_more=function(){$.get(app_path+'/Post/load_more/id/'+self.id,function(result){self.content(result);self.has_more(0);});}}
function ViewModel(){this.posts=ko.observableArray();this.comment_id=ko.observable(0);this.expand_id=ko.observable(0);this.expand_content=ko.observable();var self=this;for(var i in posts){var p=posts[i];this.posts.push(new Post(p.id,p.title,p.content,p.user_id,p.user_name,p.publish_time,p.is_event,p.comment_count,p.can_edit,p.has_more));}
this.view_comments=function(post){console.log(post);self.comment_id(post.id);}
this.load_more=function(post){$.get(app_path+'/Post/load_more/id/'+post.id,function(result){self.expand_content(result);self.expand_id(post.id);});}}
ko.applyBindings(new ViewModel(),document.getElementById('timeline-view'));